function setup() {
    return {
        input: [
            {
              bands: ["B01","B02","B03","B04","B05","B06","B07","B08","B11","B12"],
              units: "DN"
            },
        ],
        output: [
            {
              bands: 3,
              sampleType: "AUTO"
            }
        ]
    }
 }
 
 let factor = 3.5
 function evaluatePixel(sample) {  
 
    let NDVI = (sample.B08 - sample.B04)/(sample.B08 + sample.B04)
    let NDVI_RE1 = (sample.B08 - sample.B05)/(sample.B08 + sample.B05)
    let NDVI_RE2 = (sample.B08 - sample.B06)/(sample.B08 + sample.B06)
    let NDVI_GREEN = (sample.B08 - sample.B03)/(sample.B08 + sample.B03)
    let NBSI = (sample.B11 + sample.B04 - (sample.B08 + sample.B02))/(sample.B11 + sample.B04 + (sample.B08 + sample.B02))
    let CL_GREEN = sample.B07/sample.B03 - 1
    let NDWI = (sample.B03 - sample.B08)/(sample.B03 + sample.B08)
    let STI = sample.B11 / sample.B12
 
    let BLDG_PROBA = predict(sample.B01/1.e4,sample.B02/1.e4,sample.B03/1.e4,sample.B04/1.e4,NDVI,NDWI,NDVI_GREEN,NDVI_RE1,NDVI_RE2,NBSI,CL_GREEN,STI)
 
    if (BLDG_PROBA > 0.8) {
        return [sample.B04/1.e4, sample.B03/1.e4, 0.75 + sample.B02/1.e4]
    }
    return [factor*sample.B04/1.e4, factor*sample.B03/1.e4, factor*sample.B02/1.e4];
 }
 
 
